import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Header from "../src/components/header.js";
import Homepage from "../src/components/homepage.js";
import AboutUs from "../src/components/about-us.js";
import Resources from "../src/components/resources.js";
import SelfAssessmentQuiz from './components/self-assessment-quiz';
import { Outlet } from "react-router-dom";

const Layout = () => (
  <>
    <Header /> {/* Always visible */}
    <Outlet /> {/* Child routes will render here */}
  </>
);

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Wrap all routes inside the Layout */}
        <Route element={<Layout />}>
          <Route path="/" element={<Homepage />} />
          <Route path="/about-us" element={<AboutUs />} />
          <Route path="/wellness-history" element={<SelfAssessmentQuiz />} />
          <Route path="/resources" element={<Resources />} />
        </Route>
      </Routes>
    </Router>
  );
};

export default App;
